import React from "react";
import { Switch, Route } from "react-router-dom";
import Navs from "./components/Navs";
function App() {
  return (
    <div>
      <Navs />
      <Switch>
        <Route exact={true} path="/">
          This is Home page
        </Route>
        <Route exact={true} path="/starred">
          This is starrred
        </Route>
        <Route>This is 404 page</Route>
      </Switch>
    </div>
  );
}

export default App;
